import React from 'react';
import './spinner.scss';

const WithSpinner = (WrappedComponent) => ({ isLoading, ...otherProps }) => {
  return isLoading ? (
    <div className='spinnerOverlay'>
      <div className='spinnerContainer' />
    </div>)
    : (
      <WrappedComponent {...otherprops} />
    )
}



export default WithSpinner;
